import React from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';

const Map = () => {
    // Coordinates for 10027 (New York)
    const center = [40.811550, -73.953300];

    // Sample locations for hospitals, gyms, and social services
    const locations = [
        { name: 'Hospital 1', position: [40.810, -73.950] },
        { name: 'Hospital 2', position: [40.805, -73.955] },
        { name: 'Gym 1', position: [40.815, -73.945] },
        { name: 'Department of Social Services', position: [40.812, -73.960] }
    ];

    return (
        <div className="dashboard-section" style={{ float: 'right', width: '50%', height: '500px' }}>
            <h2>Map</h2>
            <MapContainer center={center} zoom={14} style={{ width: '100%', height: '100%' }}>
                <TileLayer
                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                    attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                />
                {/* Render markers for each location */}
                {locations.map((location, index) => (
                    <Marker key={index} position={location.position}>
                        <Popup>{location.name}</Popup>
                    </Marker>
                ))}
            </MapContainer>
        </div>
    );
};

export default Map;
